class Solution {
    /**
    Test if given string is a palindrome
     */
    public boolean isPalindrome(String string) {
        int i = 0;
        int j = string.length() - 1;
        while (i < j) {
            if (string.charAt(i)!= string.charAt(j)) {
                return false;
            }
            i++;
            j--;
        }
        return true;
    }

    /**
    Find the longest postfix of a string that is a palindrome
     */
    public String findLongestPalindromicPostfix(String string) {
        for (int i = string.length(); i > 0; i--) {
            String postfix = string.substring(i - 1);
            if (isPalindrome(postfix)) {
                return postfix;
            }
        }
        return "";
    }

    /**
    Reverse the prefix of a string excluding the palindromic postfix
     */
    public String reversePrefix(String string, String postfix) {
        int prefixLength = string.length() - postfix.length();
        String prefix = string.substring(0, prefixLength);
        StringBuilder reversedPrefix = new StringBuilder(prefix).reverse();
        return reversedPrefix.toString();
    }

    /**
    Find the shortest palindrome that begins with a supplied string.
    Algorithm idea is simple:
    - Find the longest postfix of supplied string that is a palindrome.
    - Append to the end of the string reverse of a string prefix that comes before the palindromic suffix.
    >>> make_palindrome("")
    ""
    >>> make_palindrome("cat")
    "catac"
    >>> make_palindrome("cata")
    "catac"
     */
    public String make_palindrome(String string) {
        if (string.isEmpty()) {
            return "";
        }
        String postfix = findLongestPalindromicPostfix(string);
        String reversedPrefix = reversePrefix(string, postfix);
        return string + reversedPrefix;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                Objects.equals(s.make_palindrome(""), ""),
                Objects.equals(s.make_palindrome("x"), "x"),
                Objects.equals(s.make_palindrome("xyz"), "xyzyx"),
                Objects.equals(s.make_palindrome("xyx"), "xyx"),
                Objects.equals(s.make_palindrome("jerry"), "jerryrrej")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

