class Solution {
    /**
    Input to this function is a string containing multiple groups of nested parentheses. Your goal is to
    separate those group into separate strings and return the list of those.
    Separate groups are balanced (each open brace is properly closed) and not nested within each other
    Ignore any spaces in the input string.
    >>> separate_paren_groups("( ) (( )) (( )( ))")
    ["()", "(())", "(()())"]
     */
    public List<String> separate_paren_groups(String paren_string) {
        // Remove spaces from the input string
        String input = removeSpaces(paren_string);

        // Initialize an empty list to store the start and end indices of each parenthesis group
        List<int[]> indices = new ArrayList<>();

        // Identify the start and end indices of each parenthesis group
        identifyGroups(input, indices);

        // Extract each parenthesis group from the input string
        List<String> groups = extractGroups(input, indices);

        // Return the list of separated parenthesis groups
        return groups;
    }

    // Method to remove spaces from the input string
    private String removeSpaces(String input) {
        return input.replaceAll("\\s", "");
    }

    // Method to identify the start and end indices of each parenthesis group
    private void identifyGroups(String input, List<int[]> indices) {
        int start = -1;
        int count = 0;

        for (int i = 0; i < input.length(); i++) {
            char c = input.charAt(i);

            if (c == '(') {
                if (start == -1) {
                    start = i;
                }
                count++;
            } else if (c == ')') {
                count--;
                if (count == 0) {
                    indices.add(new int[] {start, i});
                    start = -1;
                }
            }
        }
    }

    // Method to extract each parenthesis group from the input string
    private List<String> extractGroups(String input, List<int[]> indices) {
        List<String> groups = new ArrayList<>();

        for (int[] index : indices) {
            groups.add(input.substring(index[0], index[1] + 1));
        }

        return groups;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.separate_paren_groups("(()()) ((())) () ((())()())").equals(Arrays.asList(
                        "(()())", "((()))", "()", "((())()())"
                )),
                s.separate_paren_groups("() (()) ((())) (((())))").equals(Arrays.asList(
                        "()", "(())", "((()))", "(((())))"
                )),
                s.separate_paren_groups("(()(())((())))").equals(Arrays.asList(
                        "(()(())((())))"
                )),
                s.separate_paren_groups("( ) (( )) (( )( ))").equals(Arrays.asList("()", "(())", "(()())"))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

