class Solution {
    /**
    Filter an input list of strings only for ones that contain given substring
    >>> filter_by_substring(List.of(), "a")
    []
    >>> filter_by_substring(Arrays.asList("abc", "bacd", "cde", "array"), "a")
    ["abc", "bacd", "array"]
     */
    public List<String> filter_by_substring(List<String> strings, String substring) {
        if (strings == null || substring == null) {
            throw new NullPointerException("Input list and substring cannot be null");
        }

        List<String> result = new ArrayList<>();

        for (String str : strings) {
            if (str.contains(substring)) {
                result.add(str);
            }
        }

        return result;
    }
}

