class Solution {
    /**
    Input is a space-delimited string of numberals from 'zero' to 'nine'.
    Valid choices are 'zero', 'one', 'two', 'three', 'four', 'five', 'six', 'seven', 'eight' and 'nine'.
    Return the string with numbers sorted from smallest to largest
    >>> sort_numbers("three one five")
    "one three five"
     */
    public String sort_numbers(String numbers) {
        String[] numArray = numbers.split(" ");
        Map<String, Integer> numMap = new HashMap<>();
        numMap.put("zero", 0);
        numMap.put("one", 1);
        numMap.put("two", 2);
        numMap.put("three", 3);
        numMap.put("four", 4);
        numMap.put("five", 5);
        numMap.put("six", 6);
        numMap.put("seven", 7);
        numMap.put("eight", 8);
        numMap.put("nine", 9);

        Integer[] numValues = new Integer[numArray.length];
        for (int i = 0; i < numArray.length; i++) {
            numValues[i] = numMap.get(numArray[i]);
        }

        Arrays.sort(numValues);

        String[] sortedNumArray = new String[numValues.length];
        for (int i = 0; i < numValues.length; i++) {
            for (Map.Entry<String, Integer> entry : numMap.entrySet()) {
                if (entry.getValue().equals(numValues[i])) {
                    sortedNumArray[i] = entry.getKey();
                    break;
                }
            }
        }

        return String.join(" ", sortedNumArray);
    }
}

