class Solution {
    /**
    Return true if a given number is prime, and false otherwise.
    >>> is_prime(6)
    false
    >>> is_prime(101)
    true
    >>> is_prime(11)
    true
    >>> is_prime(13441)
    true
    >>> is_prime(61)
    true
    >>> is_prime(4)
    false
    >>> is_prime(1)
    false
     */
    public boolean is_prime(int n) {
        if (n <= 1) {
            return false;
        }
        if (n == 2) {
            return true;
        }
        if (n % 2 == 0) {
            return false;
        }
        for (int i = 3; i * i <= n; i += 2) {
            if (n % i == 0) {
                return false;
            }
        }
        return true;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                !s.is_prime(6),
                s.is_prime(101),
                s.is_prime(11),
                s.is_prime(13441),
                s.is_prime(61),
                !s.is_prime(4),
                !s.is_prime(1),
                s.is_prime(5),
                s.is_prime(11),
                s.is_prime(17),
                !s.is_prime(5 * 17),
                !s.is_prime(11 * 7),
                !s.is_prime(13441 * 19)
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

