class Solution {
    /**
    Return only positive numbers in the list.
    >>> get_positive(Arrays.asList(-1, 2, -4, 5, 6))
    [2, 5, 6]
    >>> get_positive(Arrays.asList(5, 3, -5, 2, -3, 3, 9, 0, 123, 1, -10))
