     */
    public List<Integer> get_positive(List<Integer> l) {
        if (l == null) {
            throw new NullPointerException("Input list cannot be null");
        }
        return l.stream()
                .filter(num -> num > 0)
                .collect(Collectors.toList());
    }
}

