class Solution {
    /**
    Return maximum element in the list.
    >>> max_element(Arrays.asList(1, 2, 3))
    3
    >>> max_element(Arrays.asList(5, 3, -5, 2, -3, 3, 9, 0, 123, 1, -10))
    123
     */
    public int max_element(List<Integer> l) {
        if (l == null || l.isEmpty()) {
            throw new IllegalArgumentException("Input list is null or empty");
        }
        int max = l.get(0);
        for (int i = 1; i < l.size(); i++) {
            if (l.get(i) > max) {
                max = l.get(i);
            }
        }
        return max;
    }
}

