class Car {
    int id;
    double position;
    double speed;
    boolean direction; // true for left to right, false for right to left

    public Car(int id, double position, double speed, boolean direction) {
        this.id = id;
        this.position = position;
        this.speed = speed;
        this.direction = direction;
    }
}

class Solution {
    /**
    Imagine a road that's a perfectly straight infinitely long line.
    n cars are driving left to right;  simultaneously, a different set of n cars
    are driving right to left.   The two sets of cars start out being very far from
    each other.  All cars move in the same speed.  Two cars are said to collide
    when a car that's moving left to right hits a car that's moving right to left.
    However, the cars are infinitely sturdy and strong; as a result, they continue moving
    in their trajectory as if they did not collide.

    This function outputs the number of such collisions.
     */
    public int car_race_collision(int n) {
        // Initialize cars and simulation parameters
        Car[] leftToRight = new Car[n];
        Car[] rightToLeft = new Car[n];
        double speed = 1.0; // constant speed
        double dt = 0.01; // time step
        int maxTimeSteps = 1000; // termination condition
        double epsilon = 0.001; // small value for collision detection

        // Initialize car positions
        for (int i = 0; i < n; i++) {
            leftToRight[i] = new Car(i, -1000 + i * 10, speed, true);
            rightToLeft[i] = new Car(i, 1000 - i * 10, speed, false);
        }

        // Simulate car movement and detect collisions
        int collisions = 0;
        for (int t = 0; t < maxTimeSteps; t++) {
            // Update car positions
            for (Car car : leftToRight) {
                car.position += speed * dt;
            }
            for (Car car : rightToLeft) {
                car.position -= speed * dt;
            }

            // Detect collisions
            for (Car car1 : leftToRight) {
                for (Car car2 : rightToLeft) {
                    if (Math.abs(car1.position - car2.position) <= epsilon) {
                        collisions++;
                    }
                }
            }
        }

        return collisions;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.car_race_collision(2) == 4,
                s.car_race_collision(3) == 9,
                s.car_race_collision(4) == 16,
                s.car_race_collision(8) == 64,
                s.car_race_collision(10) == 100
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

