class Solution {
    /**
    prime_fib returns n-th number that is a Fibonacci number and it's also prime.
    >>> prime_fib(1)
    2
    >>> prime_fib(2)
    3
    >>> prime_fib(3)
    5
    >>> prime_fib(4)
    13
    >>> prime_fib(5)
    89
     */
    public int prime_fib(int n) {
        if (n <= 0) {
            throw new IllegalArgumentException("n must be a positive integer");
        }

        int count = 0;
        int a = 0;
        int b = 1;

        while (true) {
            int temp = a;
            a = b;
            b = temp + b;

            if (isPrime(a)) {
                count++;
                if (count == n) {
                    return a;
                }
            }
        }
    }

    private boolean isPrime(int number) {
        if (number <= 1) {
            return false;
        }
        if (number == 2) {
            return true;
        }
        if (number % 2 == 0) {
            return false;
        }

        int sqrt = (int) Math.sqrt(number);
        for (int i = 3; i <= sqrt; i += 2) {
            if (number % i == 0) {
                return false;
            }
        }
        return true;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.prime_fib(1) == 2,
                s.prime_fib(2) == 3,
                s.prime_fib(3) == 5,
                s.prime_fib(4) == 13,
                s.prime_fib(5) == 89,
                s.prime_fib(6) == 233,
                s.prime_fib(7) == 1597,
                s.prime_fib(8) == 28657,
                s.prime_fib(9) == 514229,
                s.prime_fib(10) == 433494437
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

