class Solution {
    /**
    Return median of elements in the list l.
    >>> median(Arrays.asList(3, 1, 2, 4, 5))
    3
    >>> median(Arrays.asList(-10, 4, 6, 1000, 10, 20))
    8.0
     */
    public double median(List<Integer> l) {
        if (l == null || l.isEmpty()) {
            throw new IllegalArgumentException("Input list is empty or null");
        }

        List<Integer> sortedList = new ArrayList<>(l);
        Collections.sort(sortedList);

        int n = sortedList.size();
        if (n % 2 == 0) {
            return (sortedList.get(n / 2 - 1) + sortedList.get(n / 2)) / 2.0;
        } else {
            return (double) sortedList.get(n / 2);
        }
    }
}

