class Solution {
    /**
    Circular shift the digits of the integer x, shift the digits right by shift
    and return the result as a string.
    If shift > number of digits, return digits reversed.
    >>> circular_shift(12, 1)
    "21"
    >>> circular_shift(12, 2)
    "12"
     */
    public String circular_shift(int x, int shift) {
        String digitString = String.valueOf(x);
        int numDigits = digitString.length();
        int effectiveShift = shift % numDigits;

        if (shift > numDigits) {
            StringBuilder reversedDigits = new StringBuilder(digitString).reverse();
            return reversedDigits.toString();
        } else {
            String shiftedDigits = digitString.substring(numDigits - effectiveShift) + digitString.substring(0, numDigits - effectiveShift);
            return shiftedDigits;
        }
    }
}

