    will_it_fly(Arrays.asList(3, 2, 3), 9) -> true
    # 3+2+3 is less than the maximum possible weight, and it's balanced.

    will_it_fly(Arrays.asList(3), 5) -> true
    # 3 is less than the maximum possible weight, and it's balanced.
     */
    public boolean will_it_fly(List<Integer> q, int w) {
        // Input Validation
        if (q.isEmpty() || w < 0) {
            return false;
        }

        // Check if the list is palindromic
        boolean isPalindromic = isPalindrome(q);

        // Calculate the sum of the list elements
        int sum = calculateSum(q);

        // Compare the sum with the maximum possible weight
        boolean isWithinWeight = sum <= w;

        // Return the final result
        return isPalindromic && isWithinWeight;
    }

    // Helper function to check if the list is palindromic
    private boolean isPalindrome(List<Integer> list) {
        int left = 0;
        int right = list.size() - 1;
        while (left < right) {
            if (!list.get(left).equals(list.get(right))) {
                return false;
            }
            left++;
            right--;
        }
        return true;
    }

    // Helper function to calculate the sum of the list elements
    private int calculateSum(List<Integer> list) {
        int sum = 0;
        for (Integer num : list) {
            sum += num;
        }
        return sum;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.will_it_fly(new ArrayList<>(Arrays.asList(3, 2, 3)), 9),
                !s.will_it_fly(new ArrayList<>(Arrays.asList(1, 2)), 5),
                s.will_it_fly(new ArrayList<>(List.of(3)), 5),
                !s.will_it_fly(new ArrayList<>(Arrays.asList(3, 2, 3)), 1),
                !s.will_it_fly(new ArrayList<>(Arrays.asList(1, 2, 3)), 6),
                s.will_it_fly(new ArrayList<>(List.of(5)), 5)
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

