class Solution {
    /**
    Write a function that returns true if the given number is the multiplication of 3 prime numbers
    and false otherwise.
    Knowing that the prime number is less then 100.
    Example:
    is_multiply_prime(30) == true
    30 = 2 * 3 * 5
     */
    public boolean is_multiply_prime(int a) {
        List<Integer> primes = generatePrimes();
        return findPrimeFactors(a, primes);
    }

    private List<Integer> generatePrimes() {
        List<Integer> primes = new ArrayList<>();
        for (int i = 2; i < 100; i++) {
            if (isPrime(i)) {
                primes.add(i);
            }
        }
        return primes;
    }

    private boolean isPrime(int n) {
        if (n <= 1) {
            return false;
        }
        for (int i = 2; i * i <= n; i++) {
            if (n % i == 0) {
                return false;
            }
        }
        return true;
    }

    private boolean findPrimeFactors(int n, List<Integer> primes) {
        for (int i = 0; i < primes.size(); i++) {
            for (int j = i; j < primes.size(); j++) {
                for (int k = j; k < primes.size(); k++) {
                    if (n == primes.get(i) * primes.get(j) * primes.get(k)) {
                        return true;
                    }
                }
            }
        }
        return false;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                !s.is_multiply_prime(5),
                s.is_multiply_prime(30),
                s.is_multiply_prime(8),
                !s.is_multiply_prime(10),
                s.is_multiply_prime(125),
                s.is_multiply_prime(3 * 5 * 7),
                !s.is_multiply_prime(3 * 6 * 7),
                !s.is_multiply_prime(9 * 9 * 9),
                !s.is_multiply_prime(11 * 9 * 9),
                s.is_multiply_prime(11 * 13 * 7)
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

