class Solution {
    /**
    Write a function that accepts two lists of strings and returns the list that has
    total number of chars in the all strings of the list less than the other list.

    if the two lists have the same number of chars, return the first list.

    Examples
    total_match(Arrays.asList(), Arrays.asList()) -> []
    total_match(Arrays.asList("hi", "admin"), Arrays.asList("hI", "Hi")) -> ["hI", "Hi"]
    total_match(Arrays.asList("hi", "admin"), Arrays.asList("hi", "hi", "admin", "project")) -> ["hi", "admin"]
    total_match(Arrays.asList("hi", "admin"), Arrays.asList("hI", "hi", "hi")) -> ["hI", "hi", "hi"]
    total_match(Arrays.asList("4"), Arrays.asList("1", "2", "3", "4", "5")) -> ["4"]
     */
    public List<String> total_match(List<String> lst1, List<String> lst2) {
        int totalChars1 = calculateTotalChars(lst1);
        int totalChars2 = calculateTotalChars(lst2);

        if (totalChars1 <= totalChars2) {
            return lst1;
        } else {
            return lst2;
        }
    }

    private int calculateTotalChars(List<String> lst) {
        int totalChars = 0;
        for (String str : lst) {
            totalChars += str.length();
        }
        return totalChars;
    }
}

