class Solution {
    /**
    You are given a string s.
    Your task is to check if the string is happy or not.
    A string is happy if its length is at least 3 and every 3 consecutive letters are distinct
    For example:
    is_happy(a) => false
    is_happy(aa) => false
    is_happy(abcd) => true
    is_happy(aabb) => false
    is_happy(adb) => true
    is_happy(xyy) => false
     */
    public boolean is_happy(String s) {
        if (s == null || s.length() == 0) {
            throw new IllegalArgumentException("Invalid input");
        }

        if (s.length() < 3) {
            return false;
        }

        for (int i = 0; i <= s.length() - 3; i++) {
            String window = s.substring(i, i + 3);
            if (!areDistinct(window)) {
                return false;
            }
        }

        return true;
    }

    private boolean areDistinct(String window) {
        return window.charAt(0) != window.charAt(1) &&
               window.charAt(0) != window.charAt(2) &&
               window.charAt(1) != window.charAt(2);
    }
}

