        long countEndWithOne = 9 * (long) Math.pow(10, n - 2);
        long overlapCount = (n > 1) ? 9 * (long) Math.pow(10, n - 3) : 1;

        return (int) (countStartWithOne + countEndWithOne - overlapCount);
    }
}

