            } else if (gpa >= 2.7) {
                letterGrades.add("B");
            } else if (gpa >= 2.3) {
                letterGrades.add("B-");
            } else if (gpa >= 2.0) {
                letterGrades.add("C+");
            } else if (gpa >= 1.7) {
                letterGrades.add("C");
            } else if (gpa >= 1.3) {
                letterGrades.add("C-");
            } else if (gpa >= 1.0) {
                letterGrades.add("D+");
            } else if (gpa >= 0.7) {
                letterGrades.add("D");
            } else if (gpa >= 0.0) {
                letterGrades.add("D-");
            } else {
                letterGrades.add("E");
            }
        }
        return letterGrades;
    }
}

