class Solution {
    /**
    You'll be given a string of words, and your task is to count the number
    of boredoms. A boredom is a sentence that starts with the word "I".
    Sentences are delimited by '.', '?' or '!'.

    For example:
    >>> is_bored("Hello world")
    0
    >>> is_bored("The sky is blue. The sun is shining. I love this weather")
    1
     */
    public int is_bored(String S) {
        // Remove leading and trailing whitespace
        S = S.trim();

        // Split the input string into individual sentences
        String[] sentences = S.split("[.!?]+");

        // Initialize a counter variable to keep track of the number of boredoms
        int boredomCount = 0;

        // Iterate through each sentence
        for (String sentence : sentences) {
            // Remove leading and trailing whitespace from the sentence
            sentence = sentence.trim();

            // Check if the sentence starts with the word "I" (case-insensitive)
            if (!sentence.isEmpty() && Character.toLowerCase(sentence.charAt(0)) == 'i') {
                // If it does, increment the boredom count
                boredomCount++;
            }
        }

        // Return the total count of boredoms
        return boredomCount;
    }
}

