            // Check if the string key is in lower case or upper case
            String strKey = (String) key;
            if (!strKey.equals(strKey.toLowerCase()) && !strKey.equals(strKey.toUpperCase())) {
                return false;
            }
        }

        // If all checks pass, return true
        return true;
    }
}

