      arr = [1, -1 , 55]
            -> sort arr -> [-1, 1, 55]
            -> reverse arr -> [55, 1, -1]
      return = ["One"]
     */
    public List<String> by_length(List<Integer> arr) {
        if (arr.isEmpty()) {
            return new ArrayList<>();
        }

        String[] digitNames = {"One", "Two", "Three", "Four", "Five", "Six", "Seven", "Eight", "Nine"};
        List<Integer> filteredList = new ArrayList<>();

        for (Integer num : arr) {
            if (num >= 1 && num <= 9) {
                filteredList.add(num);
            }
        }

        Collections.sort(filteredList);
        Collections.reverse(filteredList);

        List<String> result = new ArrayList<>();
        for (Integer num : filteredList) {
            result.add(digitNames[num - 1]);
        }

        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.by_length(new ArrayList<>(Arrays.asList(2, 1, 1, 4, 5, 8, 2, 3))).equals(Arrays.asList("Eight", "Five", "Four", "Three", "Two", "Two", "One", "One" )),
                s.by_length(new ArrayList<>(List.of())).equals(List.of()),
                s.by_length(new ArrayList<>(Arrays.asList(1, -1, 55))).equals(List.of("One" )),
                s.by_length(new ArrayList<>(Arrays.asList(1, -1, 3, 2))).equals(Arrays.asList("Three", "Two", "One" )),
                s.by_length(new ArrayList<>(Arrays.asList(9, 4, 8))).equals(Arrays.asList("Nine", "Eight", "Four" ))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

