class Solution {
    /**
    Given a string representing a space separated lowercase letters, return a dictionary
    of the letter with the most repetition and containing the corresponding count.
    If several letters have the same occurrence, return all of them.

    Example:
    histogram("a b c") == {"a": 1, "b": 1, "c": 1}
    histogram("a b b a") == {"a": 2, "b": 2}
    histogram("a b c a b") == {"a": 2, "b": 2}
    histogram("b b b b a") == {"b": 4}
    histogram("") == {}
     */
    public Map<String,Integer> histogram(String test) {
        Map<String, Integer> letterCount = new HashMap<>();
        Map<String, Integer> maxCountMap = new HashMap<>();
        int maxCount = 0;

        if (test.isEmpty()) {
            return maxCountMap;
        }

        String[] letters = test.split(" ");

        for (String letter : letters) {
            letterCount.put(letter, letterCount.getOrDefault(letter, 0) + 1);
        }

        maxCount = Collections.max(letterCount.values());

        for (Map.Entry<String, Integer> entry : letterCount.entrySet()) {
            if (entry.getValue() == maxCount) {
                maxCountMap.put(entry.getKey(), entry.getValue());
            }
        }

        return maxCountMap;
    }
}

