class Solution {
    /**
    Task
    We are given two strings s and c, you have to deleted all the characters in s that are equal to any character in c
    then check if the result string is palindrome.
    A string is called palindrome if it reads the same backward as forward.
    You should return a tuple containing the result string and true/false for the check.
    Example
    For s = "abcde", c = "ae", the result should be ("bcd",false)
    For s = "abcdef", c = "b"  the result should be ("acdef",false)
    For s = "abcdedcba", c = "ab", the result should be ("cdedc",true)
     */
    public List<Object> reverse_delete(String s, String c) {
        // Character Deletion
        StringBuilder sb = new StringBuilder();
        for (char ch : s.toCharArray()) {
            if (c.indexOf(ch) == -1) {
                sb.append(ch);
            }
        }
        String resultString = sb.toString();

        // Palindrome Check
        boolean isPalindrome = true;
        int left = 0;
        int right = resultString.length() - 1;
        while (left < right) {
            if (resultString.charAt(left) != resultString.charAt(right)) {
                isPalindrome = false;
                break;
            }
            left++;
            right--;
        }

        // Result Construction
        List<Object> result = new ArrayList<>();
        result.add(resultString);
        result.add(isPalindrome);
        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.reverse_delete("abcde", "ae" ).equals(Arrays.asList("bcd", false)),
                s.reverse_delete("abcdef", "b" ).equals(Arrays.asList("acdef", false)),
