                if (word.charAt(i - 1) != c && vowels.indexOf(word.charAt(i - 1)) == -1 
                    && (i + 1 < word.length() ? vowels.indexOf(word.charAt(i + 1)) == -1 : true)) {
                    closestVowel = String.valueOf(c);
                    break;
                }
            }
        }

        return closestVowel;
    }
}

