class Solution {
    /**
    Given a string s and a natural number n, you have been tasked to implement
    a function that returns a list of all words from string s that contain exactly
    n consonants, in order these words appear in the string s.
    If the string s is empty then the function should return an empty list.
    Note: you may assume the input string contains only letters and spaces.
    Examples:
    select_words("Mary had a little lamb", 4) ==> ["little"]
    select_words("Mary had a little lamb", 3) ==> ["Mary", "lamb"]
    select_words("simple white space", 2) ==> []
    select_words("Hello world", 4) ==> ["world"]
    select_words("Uncle sam", 3) ==> ["Uncle"]
     */
    public List<String> select_words(String s, int n) {
        // Tokenize the input string
        String[] words = s.split("\\s+");

        // Initialize an empty list to store the result
        List<String> result = new ArrayList<>();

        // Iterate through each word in the array
        for (String word : words) {
            // Count the number of consonants in the word
            int consonantCount = countConsonants(word);

            // If the word has exactly n consonants, add it to the result list
            if (consonantCount == n) {
                result.add(word);
            }
        }

        // Return the list of selected words
        return result;
    }

    // Helper method to count the number of consonants in a word
    private int countConsonants(String word) {
        int count = 0;
        for (char c : word.toLowerCase().toCharArray()) {
            if (isConsonant(c)) {
                count++;
            }
        }
        return count;
    }

    // Helper method to check if a character is a consonant
    private boolean isConsonant(char c) {
        return c >= 'a' && c <= 'z' && !isVowel(c);
    }

    // Helper method to check if a character is a vowel
    private boolean isVowel(char c) {
        return c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u';
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.select_words("Mary had a little lamb", 4).equals(List.of("little" )),
                s.select_words("Mary had a little lamb", 3).equals(Arrays.asList("Mary", "lamb")),
                s.select_words("simple white space", 2).equals(List.of()),
                s.select_words("Hello world", 4).equals(List.of("world" )),
                s.select_words("Uncle sam", 3).equals(List.of("Uncle" )),
                s.select_words("", 4).equals(List.of()),
                s.select_words("a b c d e f", 1).equals(Arrays.asList("b", "c", "d", "f"))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
