class Solution {
    /**
    You are given a list of two strings, both strings consist of open
    parentheses "(" or close parentheses ")" only.
    Your job is to check if it is possible to concatenate the two strings in
    some order, that the resulting string will be good.
    A string S is considered to be good if and only if all parentheses in S
    are balanced. For example: the string "(())()" is good, while the string
    "())" is not.
    Return "Yes" if there"s a way to make a good string, and return "No" otherwise.

    Examples:
    match_parens(Arrays.asList("()(", ")")) == "Yes"
    match_parens(Arrays.asList(")", ")")) == "No"
     */
    public String match_parens(List<String> lst) {
        int openCount1 = 0, closeCount1 = 0, openCount2 = 0, closeCount2 = 0;

        // Count Open and Close Parentheses
        for (char c : lst.get(0).toCharArray()) {
            if (c == '(') openCount1++;
            else closeCount1++;
        }

        for (char c : lst.get(1).toCharArray()) {
            if (c == '(') openCount2++;
            else closeCount2++;
        }

        // Determine Balance
        int totalOpen = openCount1 + openCount2;
        int totalClose = closeCount1 + closeCount2;

        if (totalOpen != totalClose) return "No";

        // Check Concatenation Orders
        if (openCount1 >= closeCount2 && openCount2 >= closeCount1) return "Yes";
        else return "No";
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.match_parens(Arrays.asList("()(", ")")).equals("Yes"),
                s.match_parens(Arrays.asList(")", ")")).equals("No"),
                s.match_parens(Arrays.asList("(()(())", "())())")).equals("No"),
