    intersection((-1, 1), (0, 4)) ==> "NO"
    intersection((-3, -1), (-5, 5)) ==> "YES"
     */
    public String intersection(List<Integer> interval1, List<Integer> interval2) {
        // Find the intersection of the two intervals
        int start = Math.max(interval1.get(0), interval2.get(0));
        int end = Math.min(interval1.get(1), interval2.get(1));

        // If the intersection is empty, return "NO"
        if (start > end) {
            return "NO";
        }

        // Calculate the length of the intersection
        int length = end - start + 1;

        // If the length is 0 or 1, return "NO"
        if (length <= 1) {
            return "NO";
        }

        // Check if the length is a prime number
        if (isPrime(length)) {
            return "YES";
        } else {
            return "NO";
        }
    }

    // Helper function to check if a number is prime
    private boolean isPrime(int n) {
        if (n <= 1) {
            return false;
        }
        for (int i = 2; i <= Math.sqrt(n); i++) {
            if (n % i == 0) {
                return false;
            }
        }
        return true;
    }
}

