class Solution {
    /**
    Create a function that takes integers, floats, or strings representing
    real numbers, and returns the larger variable in its given variable type.
    Return None if the values are equal.
    Note: If a real number is represented as a string, the floating point might be . or ,

    compare_one(1, 2.5) -> Optional.of(2.5)
    compare_one(1, "2,3") -> Optional.of("2,3")
    compare_one("5,1", "6") -> Optional.of("6")
    compare_one("1", 1) -> Optional.empty()
     */
    public Optional<Object> compare_one(Object a, Object b) {
        // Input Validation
        if (!(a instanceof Integer || a instanceof Float || a instanceof String)) {
            throw new IllegalArgumentException("Invalid input type for a");
        }
        if (!(b instanceof Integer || b instanceof Float || b instanceof String)) {
            throw new IllegalArgumentException("Invalid input type for b");
        }

        // Type Normalization
        float aValue;
        if (a instanceof String) {
            aValue = Float.valueOf(((String) a).replace(',', '.'));
        } else {
            aValue = Float.valueOf(a.toString());
        }

        float bValue;
        if (b instanceof String) {
            bValue = Float.valueOf(((String) b).replace(',', '.'));
        } else {
            bValue = Float.valueOf(b.toString());
        }

        // Comparison
        if (aValue > bValue) {
            // Type Conversion
            if (a instanceof Integer) {
                return Optional.of((int) aValue);
            } else if (a instanceof Float) {
                return Optional.of(aValue);
            } else {
                return Optional.of(a);
            }
        } else if (bValue > aValue) {
            // Type Conversion
            if (b instanceof Integer) {
                return Optional.of((int) bValue);
            } else if (b instanceof Float) {
                return Optional.of(bValue);
            } else {
                return Optional.of(b);
            }
        } else {
            // Equality Check
            return Optional.empty();
        }
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                (int) s.compare_one(1, 2).get() == 2,
                (double) s.compare_one(1, 2.5).get() == 2.5,
                (int) s.compare_one(2, 3).get() == 3,
                (int) s.compare_one(5, 6).get() == 6,
                (String) s.compare_one(1, "2,3").get() == "2,3",
                (String) s.compare_one("5,1", "6").get() == "6",
                (String) s.compare_one("1", "2").get() == "2",
                s.compare_one("1", 1).isEmpty()
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

