class Solution {
    /**
    Evaluate whether the given number n can be written as the sum of exactly 4 positive even numbers
    Example
    is_equal_to_sum_even(4) == false
    is_equal_to_sum_even(6) == false
    is_equal_to_sum_even(8) == true
     */
    public boolean is_equal_to_sum_even(int n) {
        if (n < 0) {
            return false;
        }

        for (int a = 2; a <= n / 4; a += 2) {
            for (int b = a; b <= (n - a) / 3; b += 2) {
                for (int c = b; c <= (n - a - b) / 2; c += 2) {
                    int d = n - a - b - c;
                    if (d >= 2 && d % 2 == 0) {
                        return true;
                    }
                }
            }
        }
        return false;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.is_equal_to_sum_even(4) == false,
                s.is_equal_to_sum_even(6) == false,
                s.is_equal_to_sum_even(8) == true,
                s.is_equal_to_sum_even(10) == true,
                s.is_equal_to_sum_even(11) == false,
                s.is_equal_to_sum_even(12) == true,
                s.is_equal_to_sum_even(13) == false,
                s.is_equal_to_sum_even(16) == true
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

