class Solution {
    /**
    The Brazilian factorial is defined as:
    brazilian_factorial(n) = n! * (n-1)! * (n-2)! * ... * 1!
    where n > 0

    For example:
    >>> special_factorial(4)
    288

    The function will receive an integer as input and should return the special
    factorial of this integer.
     */
    public long special_factorial(int n) {
        if (n <= 0) {
            throw new IllegalArgumentException("Input must be a positive integer.");
        }

        long result = 1;
        for (int i = n; i > 0; i--) {
            long factorial = calculateFactorial(i);
            result *= factorial;
        }
        return result;
    }

    private long calculateFactorial(int k) {
        long factorial = 1;
        for (int i = 1; i <= k; i++) {
            factorial *= i;
        }
        return factorial;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.special_factorial(4) == 288,
                s.special_factorial(5) == 34560,
                s.special_factorial(7) == 125411328000L,
                s.special_factorial(1) == 1
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

