class Solution {
    public String file_name_check(String file_name) {
        int digitCount = countDigits(file_name);
        boolean dotPresence = checkDotPresence(file_name);
        String[] parts = file_name.split("\\.");
        boolean prefixValid = validatePrefix(parts[0]);
        boolean suffixValid = validateSuffix(parts[1]);

        return combineChecks(digitCount, dotPresence, prefixValid, suffixValid) ? "Yes" : "No";
    }

    private int countDigits(String fileName) {
        int count = 0;
        for (char c : fileName.toCharArray()) {
            if (Character.isDigit(c)) {
                count++;
            }
        }
        return count;
    }

    private boolean checkDotPresence(String fileName) {
        return fileName.indexOf('.') != -1 && fileName.indexOf('.') == fileName.lastIndexOf('.');
    }

    private boolean validatePrefix(String prefix) {
        return !prefix.isEmpty() && Character.isLetter(prefix.charAt(0));
    }

    private boolean validateSuffix(String suffix) {
        return suffix.equals("txt") || suffix.equals("exe") || suffix.equals("dll");
    }

    private boolean combineChecks(int digitCount, boolean dotPresence, boolean prefixValid, boolean suffixValid) {
        return digitCount <= 3 && dotPresence && prefixValid && suffixValid;
    }
}

