class Solution {
    /**
    Write a function which sorts the given list of integers
    in ascending order according to the sum of their digits.
    Note: if there are several items with similar sum of their digits,
    order them based on their index in original list.
    If an integer is negative, then its first digit will be negative:
    e.g. -123 has digits -1, 2, and 3.

    For example:
    >>> order_by_points(Arrays.asList(1, 11, -1, -11, -12)) == [-1, -11, 1, -12, 11]
    >>> order_by_points(Arrays.asList()) == []
     */
    public List<Integer> order_by_points(List<Integer> nums) {
        List<Map.Entry<Integer, Integer>> list = new ArrayList<>();
        for (int i = 0; i < nums.size(); i++) {
            int sum = 0;
            int num = nums.get(i);
            while (num != 0) {
                sum += num % 10;
                num /= 10;
            }
            if (num < 0) sum = -sum;
            list.add(new AbstractMap.SimpleEntry<>(sum, nums.get(i)));
        }
        Collections.sort(list, (a, b) -> {
            if (a.getKey().equals(b.getKey())) {
                return Integer.compare(nums.indexOf(a.getValue()), nums.indexOf(b.getValue()));
            } else {
                return a.getKey().compareTo(b.getKey());
            }
        });
        List<Integer> result = new ArrayList<>();
        for (Map.Entry<Integer, Integer> entry : list) {
            result.add(entry.getValue());
        }
        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
