class Solution {
    /**
    Given two positive integers a and b, return the even digits between a
    and b, in ascending order. Please note that the even digits refer to even numbers less than 10.

    For example:
    generate_integers(2, 8) => [2, 4, 6, 8]
    generate_integers(8, 2) => [2, 4, 6, 8]
    generate_integers(10, 14) => []
     */
    public List<Integer> generate_integers(int a, int b) {
        if (a < 1 || b < 1) {
            throw new IllegalArgumentException("Both a and b must be positive integers.");
        }

        int min = Math.min(a, b);
        int max = Math.max(a, b);

        List<Integer> evenDigits = new ArrayList<>();

        for (int i = min; i <= max; i++) {
            if (i < 10 && i % 2 == 0) {
                evenDigits.add(i);
            }
        }

        Collections.sort(evenDigits);

        return evenDigits;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.generate_integers(2, 10).equals(Arrays.asList(2, 4, 6, 8)),
                s.generate_integers(10, 2).equals(Arrays.asList(2, 4, 6, 8)),
                s.generate_integers(132, 2).equals(Arrays.asList(2, 4, 6, 8)),
                s.generate_integers(17, 89).equals(List.of())
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

