class Solution {
    /**
    Write a function that accepts a list of strings.
    The list contains different words. Return the word with maximum number
    of unique characters. If multiple strings have maximum number of unique
    characters, return the one which comes first in lexicographical order.

    find_max(["name", "of", "string"]) == "string"
    find_max(["name", "enam", "game"]) == "enam"
    find_max(["aaaaaaa", "bb" ,"cc"]) == ""aaaaaaa"
     */
    public String find_max(List<String> words) {
        String result = "";
        int maxUniqueCount = 0;

        for (String word : words) {
            int uniqueCount = countUniqueChars(word);
            if (uniqueCount > maxUniqueCount || (uniqueCount == maxUniqueCount && word.compareTo(result) < 0)) {
                maxUniqueCount = uniqueCount;
                result = word;
            }
        }

        return result;
    }

    private int countUniqueChars(String str) {
        Set<Character> uniqueChars = new HashSet<>();
        for (char c : str.toCharArray()) {
            uniqueChars.add(c);
        }
        return uniqueChars.size();
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.find_max(new ArrayList<>(Arrays.asList("name", "of", "string"))).equals("string"),
                s.find_max(new ArrayList<>(Arrays.asList("name", "enam", "game"))).equals("enam"),
                s.find_max(new ArrayList<>(Arrays.asList("aaaaaaa", "bb", "cc"))).equals("aaaaaaa"),
